    private long proofComposite(BigInteger input){
        int cnt = 0;
        while(input.compareTo(BigInteger.valueOf(p[cnt]*p[cnt])) > 0){
            if(p[cnt] == 0) return 1;      //too much effort to waste for this number.
            if(input.remainder(BigInteger.valueOf(p[cnt])) == BigInteger.ZERO)
                return p[cnt];
            ++cnt;
        }
        return 1;
    }

